(4678, 742, '05/13/25', 'Regional Executive Director', 'Final document review, approval of the Lumber Dealer E-Permit, Memorandum informing concerned PENROs and CENROs of the approved endorsed lumber dealer application and the acknowledgment letter for the applicant confirming that the e-permit was received.<br><br>\r\n  \r\n   Approved E-Permit and Acknowledgement Letter forwarded to Records Unit to release the documents.\r\n   ', '12:52:13pm', ''),
(4679, 773, '05/13/25', 'PENRO Evaluator FUU Returned to CENRO Forest Utilization Unit', 'Upon Reviewing the uploaded documents, we regret to inform you that your document has been returned to CENR Officer/Head DENR Satellite \r\nOffice FUU due to missing attachments. Rest assured, our team will address this matter promptly and ensure compliance with the necessary requirements.\r\n<br><br>\r\n\r\nRemarks: May 13, 2025\r\n\r\nGood day! \r\n\r\nReturned is the online application of RYC WOOD PRODUCTS MANUFACTURING for a Certificate of Registration as Lumber Dealer located at Purok 3, Nuevo Trabajo, San Luis, Agusan del Sur, with the following discerning information/documents needed for submission to support the aforesaid application, to wit: \r\n\r\n1.	Latest Income Tax Return;\r\n2.	Screenshot of proof of payment of fees (secure from bill collector);\r\n3.	Business Plan must have date/validity;\r\n4.	The notarized application form should be properly and fully filled up including the payment to be paid, date of the application and the affiant community tax certificate no., issued at and on;\r\n5.	Supplemental information such as the name of supplier, species, kind of forest products, volume to be supplied and validity should be more specific based on validated supporting documents co-terminus with approved WPP; and\r\n6.	The uploaded verification/inspection report must contain the lot status of the lumberyard and authenticity of all uploaded documents/requirements.\r\n\r\nUpon compliance thereof, resubmit the same soonest for our appraisal and further appropriate action. \r\n\r\nFor information, guidance and strict compliance.\r\n\r\n\r\n\r\n<br>\r\nReturned to  : CENRO Forest Utilization Unit ', '02:15:25pm', ''),
