(4748, 774, '05/27/25', 'PENRO Evaluator FUU Returned to CENRO Forest Utilization Unit', 'Upon Reviewing the uploaded documents, we regret to inform you that your document has been returned to CENR Officer/Head DENR Satellite \r\nOffice FUU due to missing attachments. Rest assured, our team will address this matter promptly and ensure compliance with the necessary requirements.\r\n<br><br>\r\n\r\nRemarks: May 27, 2025\r\n\r\nGood day!\r\n\r\nReturned is the online application of PANGCEL LUMBER TRADING for a Certificate of Registration as Lumber Dealer located at Purok 1, Barangay Das-agan, San Francisco, Agusan del Sur, with the following discerning information/documents needed for submission to support the aforesaid application, to wit: \r\n\r\n1.	No attached computer generated CENRO Endorsement;\r\n2.	The notarized application form should be properly and fully filled up including the date of the application and the community tax certificate no., issued at and on and;\r\n3.	All the needed data on the approved Lumber Supply Contract should be duly filled up particularly on the subscribed by the notary public the community tax certificate no., issued at and on; \r\n4.	No attached copy of approved PTPR permit, Stand and Stock Table (SST) and Certification issued by CENRO that the volume was found still available /intact in the plantation area; \r\n5.	Business Plan must have date/validity;\r\n6.	The uploaded memorandum report on the conducted ending stock inventory must contain the total volume disposed;\r\n7.	Indicate the species, volume of purchases/arrival of forest products made during the month in the summary report of production and disposition and must be notarized;\r\n8.	Ending stock inventory report in a tabulated form must contain tree species;   \r\n9.	Monthly Lumber Production and Disposition report covering the tenure of the permit should be properly and fully filled-up;\r\n10.	Duly notarized proof of ownership of the lumberyard/consent /agreement; and\r\n11.	The uploaded verification report must contain the authenticity of all uploaded documents/requirements.\r\n12.	Screenshot of proof of payment of fees (secure from bill collector);\r\n\r\nUpon compliance thereof, resubmit the same soonest for our appraisal and further appropriate action. \r\n\r\nFor information, guidance and strict compliance.\r\n<br>\r\nReturned to  : CENRO Forest Utilization Unit ', '07:51:54pm', ''),
(4749, 780, '05/28/25', 'RO Evaluator FUS Returned to CENRO Forest Utilization Unit', 'Upon Reviewing the uploaded documents, we regret to inform you that your document has been returned to CENR Officer/Head DENR Satellite \r\nOffice FUU due to missing attachments. Rest assured, our team will address this matter promptly and ensure compliance with the necessary requirements.\r\n<br><br>\r\n\r\nRemarks: 1. For the attachments of Lumber Supply Contract- Please do check the target activity to Utilize Falcata trees for CY 2025 as indicated in the Five-Year Work Plan of SAMILIA. Kindly attached either Certification/ Justification/Explanation as to the volume to be supplied to the Lumber Dealer. \r\n2. In the Annual Business Plan- It was stated that the source of lumber to be supplied to the applicant is from the PTPR holder, where in fact the from the CBFMA holder-SAMILIA. Kindly rectify. <br>\r\nReturned to  : CENRO Forest Utilization Unit ', '10:42:47am', ''),
