ement; and 11. The uploaded verification report must contain the authenticity of all uploaded documents/requirements. 12. Screenshot of proof of payment of fees (secure from bill collector); Upon compliance thereof, resubmit the same soonest for our appraisal and further appropriate action. For information, guidance and strict compliance.\r\n<br>\r\nReturned to  : CENRO Forest Utilization Unit ', '02:10:25pm', ''),
