(5005, 796, '07/11/25', 'PENRO Evaluator FUU Returned to CENRO Forest Utilization Unit', 'Upon Reviewing the uploaded documents, we regret to inform you that your document has been returned to CENR Officer/Head DENR Satellite \r\nOffice FUU due to missing attachments. Rest assured, our team will address this matter promptly and ensure compliance with the necessary requirements.\r\n<br><br>\r\n\r\nRemarks: APPLICATION FORM:\r\nKindly include, as an addendum to the uploaded application form, a Letter of Intent clearly stating the change in business location along with other important details. Also, please include the reasons for the delayed renewal of the lumber dealers permit, which expired last March 2025. \r\nImportant Note: All approved supply contracts, AB lumbers address is Brgy. Panayogon, Madrid, SDS\r\nENDING STOCKED INVENTORY REPORT:\r\nPlease attach the ending stock inventory report reflecting production and disposition for the period covering April 2024 to June 2025\r\nPROOF OWNERSHIP:\r\nUpload the Affidavit of Kinship (already sent via messenger) establishing the relationship between Elizabeth Sering, whose name appears on the rental agreement, and Marzon Lorenzo, identified as the lot owner in the tax declaration.\r\nLUMBER DEALER PHOTO:\r\nUpload a geotagged photo\r\nVERIFICATION REPORT:\r\nPlease enumerate the findings and observations on the authenticity of the proponents uploaded documents, including but not limited to changes in business location, proof of ownership, legal status of the land (alienable and disposable), and business permit registrations (such as previously issued CRLD and Mayors Permit), production and disposition.\r\nImportant Note: All approved supply contracts, AB lumbers address is Brgy. Panayogon, Madrid, SDS\r\n<br>\r\nReturned to  : CENRO Forest Utilization Unit ', '11:22:14am', ''),
