(5247, 805, '09/26/25', 'RO Evaluator FUS Returned to CENRO Forest Utilization Unit', 'Upon Reviewing the uploaded documents, we regret to inform you that your document has been returned to CENR Officer/Head DENR Satellite \r\nOffice FUU due to missing attachments. Rest assured, our team will address this matter promptly and ensure compliance with the necessary requirements.\r\n<br><br>\r\n\r\nRemarks: Kindly attached the copy of the approved PTPR of the supplier, per Memo instruction dated April 29, 2025.<br>\r\nReturned to  : CENRO Forest Utilization Unit ', '09:42:54am', ''),
(5248, 803, '09/26/25', 'RO Evaluator FUS Returned to CENRO Forest Utilization Unit', 'Upon Reviewing the uploaded documents, we regret to inform you that your document has been returned to CENR Officer/Head DENR Satellite \r\nOffice FUU due to missing attachments. Rest assured, our team will address this matter promptly and ensure compliance with the necessary requirements.\r\n<br><br>\r\n\r\nRemarks: Kindly attach the following documents\r\n1. Proof of Ownership of the lumberyard\r\n2. Proof of Payment(Screen-shot of the Reference Number)\r\n3. Proof that the lumberyard area is within A&D, per Memo instruction dated Memo April 29, 2025\r\n4.  Per Business Plan attached, it was stated that the Lumber dealer aims to display its lumber & other wood products at P-18, Sta. Irene, Prosperidad, ADS, however, per application form the applicant disclosed that its business location is in P-4, Brgy. Awa, Prosperidad, ADS. Kindly clarify this with applicant.<br>\r\nReturned to  : CENRO Forest Utilization Unit ', '10:21:49am', ''),
(5249, 801, '09/26/25', 'RO Evaluator FUS Returned to CENRO Forest Utilization Unit', 'Upon Reviewing the uploaded documents, we regret to inform you that your document has been returned to CENR Officer/Head DENR Satellite \r\nOffice FUU due to missing attachments. Rest assured, our team will address this matter promptly and ensure compliance with the necessary requirements.\r\n<br><br>\r\n\r\nRemarks: Kindly attach the following documents\r\n1.	Provide a copy of the legitimacy as Association. Also a  Board Resolution, or any Proof authorizing Mr. Jornido Singson as an authorized representative of your Association to apply for Lumber Dealer in be-half of your Association.\r\n2.	Lumber Supply Contract lacks attachments\r\n3.	Kindly check the verified lumber dealer holders per the attached Verification Report versus the attached Business Permits. If necessary, provide an Official List of Members of the Association.\r\n4.	Proof of Ownership of the lumberyard.\r\n5.	In the Verification Report, it must contain lot status, and if the uploaded requirements was authentic.\r\n6.	Proof of Payment<br>\r\nReturned to  : CENRO Forest Utilization Unit ', '12:38:30pm', ''),
(5250, 805, '09/29/25', 'CENRO Forest Utilization Unit', 'We are pleased to inform you that your document has been successfully processed by CENR Officer/Head DENR Satellite Office FUU. Rest assured that all necessary attachments have been reviewed and verified. Thank you for your patience.', '10:32:00am', ''),
